import React from "react";
import './LandingPage.css';
import "@fontsource/red-hat-display";
import sun from './resources/sun.svg';
import confederacie from './resources/confederacie.svg';
import './../min.css';

function FirstDisplay(){
    return(
        <div className="body-display">

            <div style={{align:'left'}}>
                <div className="heading-text-h2" style={{color: "#486675"}}>Help Every Digital</div>
                <div className="heading-text-h2" style={{color: "#486675"}}>Dream</div>
                <div className="heading-text-h2 underline" style={{color: "#FFC400"}}>Come Alive</div>
                <div className="outer-rim-button">Open Source Library</div>
            </div>
            <div className="logo">
                <img src={confederacie} style={{width:'100%',height:'300px'}}/>
            </div>

        </div>
    );


}
export default FirstDisplay;
